export const ProfileContent = (props: AppProps) => {



    return <div>
        <ProfileContentUser/>
        <MyPosts state={props.state} posts={props.state.profilePage.posts} removePost={props.removePost}/>

        {/*<MyPosts posts={state.profilePage.posts}/>*/}

    </div>
}
